---
:az:
  :cardinal:
    :rule: 'lambda { |num, runtime| n = runtime.n(num); i = runtime.i(num); v = runtime.v(num);
      w = runtime.w(num); f = runtime.f(num); t = runtime.t(num); (n == 1 ? :one :
      :other) }'
    :names:
    - :one
    - :other
  :ordinal:
    :rule: 'lambda { |num, runtime| n = runtime.n(num); i = runtime.i(num); v = runtime.v(num);
      w = runtime.w(num); f = runtime.f(num); t = runtime.t(num); (((((i % 10 == 1)
      || (i % 10 == 2) || (i % 10 == 5) || (i % 10 == 7) || (i % 10 == 8))) || (((i
      % 100 == 20) || (i % 100 == 50) || (i % 100 == 70) || (i % 100 == 80)))) ? :one
      : (((((i % 10 == 3) || (i % 10 == 4))) || (((i % 1000 == 100) || (i % 1000 ==
      200) || (i % 1000 == 300) || (i % 1000 == 400) || (i % 1000 == 500) || (i %
      1000 == 600) || (i % 1000 == 700) || (i % 1000 == 800) || (i % 1000 == 900))))
      ? :few : (((((i == 0) || (i % 10 == 6))) || (((i % 100 == 40) || (i % 100 ==
      60) || (i % 100 == 90)))) ? :many : :other))) }'
    :names:
    - :one
    - :few
    - :many
    - :other
